import React from "react";

const SubmitButton = ({ fetchUsers }) => {
  const handleSubmit = () => {
    fetchUsers(); // Call the fetchUsers function to refresh the list
  };

  return (
    <button type="submit" onClick={handleSubmit}>
      Submit
    </button>
  );
};

export default SubmitButton;
